import { Fab, Tooltip } from '@mui/material';
import React from 'react';
import { Add as AddIcon } from "@mui/icons-material";

const Add = () => {
    return (
        <>
        <Tooltip title="Delete" sx={{position:"fixed"}}>
            <Fab color="primary" aria-label="add">
                <AddIcon />
            </Fab>
        </Tooltip>
        </>
    );
}

export default Add;
